/*Table structure for table `user_divisions` */

DROP TABLE IF EXISTS `user_divisions`;

CREATE TABLE `user_divisions` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL,
  `year_id` int(11) DEFAULT NULL,
  `division_id` int(11) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `user_divisions` */

/*Table structure for table `users` */

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `salutation` enum('Mr.','Mrs.','Km.') COLLATE utf8mb4_unicode_ci DEFAULT 'Mr.',
  `name` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `employee_type` tinyint(1) DEFAULT '1' COMMENT '1 = Ministirial 2 = Operating',
  `division_id` int(11) DEFAULT NULL,
  `designation_id` int(11) DEFAULT NULL,
  `account_type` int(1) DEFAULT NULL COMMENT '1 = GPF, 2 = CPF',
  `account_no` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `phone` varchar(11) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `email` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `email_verified_at` timestamp NULL DEFAULT NULL,
  `password` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `role` int(2) DEFAULT NULL COMMENT '1= Superadmin, 2 = Company, 3= Employee',
  `profile_picture` text COLLATE utf8mb4_unicode_ci,
  `opening_balance` decimal(10,2) DEFAULT NULL,
  `remember_token` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `is_active` int(1) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `users_email_unique` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=453 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

